cREATE TABLE Trade_Volume_and_Trade_Balance (
    date DATE,
    commodity_exports DECIMAL(15, 2),
    commodity_imports DECIMAL(15, 2),
    trade_volume DECIMAL(15, 2),
    trade_balance DECIMAL(15, 2)
);

CREATE TABLE Commodity_Exports (
    date DATE,
    non_oil_exports DECIMAL(15, 2),
    percentage_non_oil_exports DECIMAL(5, 2),
    oil_exports DECIMAL(15, 2),
    percentage_oil_exports DECIMAL(5, 2),
    re_exports DECIMAL(15, 2),
    percentage_re_exports DECIMAL(5, 2),
    total_exports DECIMAL(15, 2)
);

CREATE TABLE Commodity_Imports (
    date DATE,
    commodity_imports DECIMAL(15, 2)
);

CREATE TABLE Imports_By_Department (
    department_description VARCHAR(255),
    date DATE,
    value DECIMAL(15, 2)
);


CREATE TABLE Exports_By_Country2 (
    country VARCHAR(255),
    date DATE,
    value DECIMAL(15, 2)
);

CREATE TABLE Non_Petroleum_Exports_Ratio (
    date DATE,
    non_petroleum_exports DECIMAL(15, 2),
    imports DECIMAL(15, 2),
    percentage_non_petroleum_exports_to_imports DECIMAL(5, 2)
);

CREATE TABLE Imports_By_Use (
    material VARCHAR(255),
    month VARCHAR(255),
    year INT,
    value DECIMAL(15, 2),
    date DATE
);

CREATE TABLE Imports_By_Material_Type (
    date DATE,
    material VARCHAR(255),
    value DECIMAL(15, 2)
);

CREATE TABLE Gross_Domestic_Product (
    year INT,
    quarter VARCHAR(255),
    total_gdp DECIMAL(15, 2)
);

CREATE TABLE General_Index (
    average_period DECIMAL(15, 2),
    general_index DECIMAL(15, 2)
);

ALTER TABLE General_Index
drop COLUMN average_period ;

ALTER TABLE General_Index
add average_period DATE;

CREATE TABLE International_Investment (
    date DATE,
    foreign_direct_investment DECIMAL(15, 2),
    domestic_direct_investment DECIMAL(15, 2),
    net_international_investment DECIMAL(15, 2)
);

CREATE TABLE Total_External_Debt (
    year INT,
    quarter VARCHAR(255),
    total_external_debt DECIMAL(15, 2)
);

CREATE TABLE Date_Table (
    date_id INT PRIMARY KEY,
    full_date DATE,
    day INT,
    month INT,
    year INT,
    fiscal_year INT
);


